20251219140000	{"-- ============================================================================\r\n-- MODULE 3: Payment Link Management\r\n-- ============================================================================\r\n-- Purpose: Create and manage Razorpay payment links for invoices\r\n-- Owns: Payment link creation, email delivery, link expiry management\r\n-- Does NOT: Process payments (Module 4), update access status (Module 5)\r\n-- ============================================================================\r\n\r\n-- ----------------------------------------------------------------------------\r\n-- 1. CREATE FUNCTION: Store Payment Link from Razorpay Response\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.store_payment_link(\r\n    p_invoice_id uuid,\r\n    p_razorpay_link_id text,\r\n    p_short_url text,\r\n    p_expires_at timestamptz,\r\n    p_razorpay_response jsonb\r\n)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_payment_link_id uuid;\r\n    v_invoice record;\r\nBEGIN\r\n    -- Verify invoice exists and is pending\r\n    SELECT id, invoice_number, booking_id, user_id, status\r\n    INTO v_invoice\r\n    FROM public.invoices\r\n    WHERE id = p_invoice_id;\r\n\r\n    IF NOT FOUND THEN\r\n        RETURN json_build_object('success', false, 'error', 'Invoice not found');\r\n    END IF;\r\n\r\n    IF v_invoice.status != 'pending' THEN\r\n        RETURN json_build_object('success', false, 'error', 'Invoice is not pending');\r\n    END IF;\r\n\r\n    -- Check if payment link already exists\r\n    IF EXISTS (SELECT 1 FROM public.payment_links WHERE invoice_id = p_invoice_id) THEN\r\n        -- Update existing link\r\n        UPDATE public.payment_links\r\n        SET \r\n            razorpay_link_id = p_razorpay_link_id,\r\n            short_url = p_short_url,\r\n            status = 'created',\r\n            expires_at = p_expires_at,\r\n            razorpay_response = p_razorpay_response,\r\n            updated_at = NOW()\r\n        WHERE invoice_id = p_invoice_id\r\n        RETURNING id INTO v_payment_link_id;\r\n    ELSE\r\n        -- Insert new payment link\r\n        INSERT INTO public.payment_links (\r\n            invoice_id,\r\n            razorpay_link_id,\r\n            short_url,\r\n            status,\r\n            expires_at,\r\n            razorpay_response\r\n        ) VALUES (\r\n            p_invoice_id,\r\n            p_razorpay_link_id,\r\n            p_short_url,\r\n            'created',\r\n            p_expires_at,\r\n            p_razorpay_response\r\n        ) RETURNING id INTO v_payment_link_id;\r\n    END IF;\r\n\r\n    RETURN json_build_object(\r\n        'success', true,\r\n        'payment_link_id', v_payment_link_id,\r\n        'invoice_id', p_invoice_id,\r\n        'invoice_number', v_invoice.invoice_number,\r\n        'short_url', p_short_url\r\n    );\r\n\r\nEXCEPTION\r\n    WHEN OTHERS THEN\r\n        RETURN json_build_object('success', false, 'error', SQLERRM);\r\nEND;\r\n$$","COMMENT ON FUNCTION public.store_payment_link IS 'Store payment link metadata from Razorpay API response'","-- ----------------------------------------------------------------------------\r\n-- 2. CREATE FUNCTION: Get Invoice Details for Payment Link Creation\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.get_invoice_for_payment_link(p_invoice_id uuid)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSTABLE\r\nAS $$\r\nDECLARE\r\n    v_result json;\r\nBEGIN\r\n    SELECT json_build_object(\r\n        'invoice_id', i.id,\r\n        'invoice_number', i.invoice_number,\r\n        'booking_id', b.id,\r\n        'booking_ref', b.booking_id,\r\n        'customer_name', b.first_name || ' ' || b.last_name,\r\n        'customer_email', b.email,\r\n        'customer_phone', b.phone,\r\n        'amount', i.amount,\r\n        'tax_amount', i.tax_amount,\r\n        'total_amount', i.total_amount,\r\n        'currency', i.currency,\r\n        'billing_period_start', i.billing_period_start,\r\n        'billing_period_end', i.billing_period_end,\r\n        'billing_month', i.billing_month,\r\n        'due_date', i.due_date,\r\n        'proration_note', i.proration_note,\r\n        'package_name', cp.name,\r\n        'status', i.status\r\n    )\r\n    INTO v_result\r\n    FROM public.invoices i\r\n    JOIN public.bookings b ON b.id = i.booking_id\r\n    LEFT JOIN public.class_packages cp ON cp.id = b.class_package_id\r\n    WHERE i.id = p_invoice_id;\r\n\r\n    RETURN v_result;\r\nEND;\r\n$$","COMMENT ON FUNCTION public.get_invoice_for_payment_link IS 'Get comprehensive invoice details for Razorpay payment link creation'","-- ----------------------------------------------------------------------------\r\n-- 3. CREATE FUNCTION: Mark Payment Links as Expired\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.expire_payment_links()\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_expired_count integer;\r\nBEGIN\r\n    UPDATE public.payment_links\r\n    SET \r\n        status = 'expired',\r\n        updated_at = NOW()\r\n    WHERE status = 'created'\r\n      AND expires_at < NOW();\r\n\r\n    GET DIAGNOSTICS v_expired_count = ROW_COUNT;\r\n\r\n    RETURN json_build_object(\r\n        'success', true,\r\n        'expired_count', v_expired_count,\r\n        'timestamp', NOW()\r\n    );\r\nEND;\r\n$$","COMMENT ON FUNCTION public.expire_payment_links IS 'Mark expired payment links (run daily via cron)'","-- ----------------------------------------------------------------------------\r\n-- 4. CREATE FUNCTION: Cancel Payment Link\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.cancel_payment_link(p_invoice_id uuid)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_payment_link record;\r\nBEGIN\r\n    -- Get payment link details\r\n    SELECT id, razorpay_link_id, status\r\n    INTO v_payment_link\r\n    FROM public.payment_links\r\n    WHERE invoice_id = p_invoice_id;\r\n\r\n    IF NOT FOUND THEN\r\n        RETURN json_build_object('success', false, 'error', 'Payment link not found');\r\n    END IF;\r\n\r\n    IF v_payment_link.status = 'cancelled' THEN\r\n        RETURN json_build_object('success', false, 'error', 'Payment link already cancelled');\r\n    END IF;\r\n\r\n    -- Update status to cancelled\r\n    UPDATE public.payment_links\r\n    SET \r\n        status = 'cancelled',\r\n        updated_at = NOW()\r\n    WHERE id = v_payment_link.id;\r\n\r\n    RETURN json_build_object(\r\n        'success', true,\r\n        'payment_link_id', v_payment_link.id,\r\n        'razorpay_link_id', v_payment_link.razorpay_link_id,\r\n        'message', 'Payment link cancelled (API cancellation required separately)'\r\n    );\r\n\r\nEXCEPTION\r\n    WHEN OTHERS THEN\r\n        RETURN json_build_object('success', false, 'error', SQLERRM);\r\nEND;\r\n$$","COMMENT ON FUNCTION public.cancel_payment_link IS 'Cancel payment link in database (caller must also cancel via Razorpay API)'","-- ----------------------------------------------------------------------------\r\n-- 5. CREATE VIEW: Pending Invoices for Payment Link Creation\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.invoices_needing_payment_links_v AS\r\nSELECT \r\n    i.id AS invoice_id,\r\n    i.invoice_number,\r\n    i.booking_id,\r\n    b.booking_id AS booking_ref,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    b.email AS customer_email,\r\n    b.phone AS customer_phone,\r\n    i.total_amount,\r\n    i.currency,\r\n    i.due_date,\r\n    i.billing_month,\r\n    i.created_at AS invoice_created_at,\r\n    EXTRACT(EPOCH FROM (NOW() - i.created_at))/3600 AS hours_since_created\r\nFROM public.invoices i\r\nJOIN public.bookings b ON b.id = i.booking_id\r\nWHERE i.status = 'pending'\r\n  AND NOT EXISTS (\r\n      SELECT 1 FROM public.payment_links pl\r\n      WHERE pl.invoice_id = i.id\r\n  )\r\nORDER BY i.created_at ASC","COMMENT ON VIEW public.invoices_needing_payment_links_v IS 'Pending invoices without active/expired payment links'","-- ----------------------------------------------------------------------------\r\n-- 6. CREATE VIEW: Active Payment Links Dashboard\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.active_payment_links_v AS\r\nSELECT \r\n    pl.id AS payment_link_id,\r\n    pl.razorpay_link_id,\r\n    pl.short_url,\r\n    pl.status,\r\n    pl.expires_at,\r\n    pl.created_at AS link_created_at,\r\n    i.id AS invoice_id,\r\n    i.invoice_number,\r\n    i.total_amount,\r\n    i.currency,\r\n    i.due_date,\r\n    i.status AS invoice_status,\r\n    b.booking_id AS booking_ref,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    b.email AS customer_email,\r\n    CASE \r\n        WHEN pl.expires_at < NOW() THEN 'expired'\r\n        WHEN pl.expires_at < NOW() + INTERVAL '24 hours' THEN 'expiring_soon'\r\n        ELSE 'active'\r\n    END AS expiry_status,\r\n    EXTRACT(EPOCH FROM (pl.expires_at - NOW()))/3600 AS hours_until_expiry\r\nFROM public.payment_links pl\r\nJOIN public.invoices i ON i.id = pl.invoice_id\r\nJOIN public.bookings b ON b.id = i.booking_id\r\nWHERE pl.status = 'created'\r\nORDER BY pl.expires_at ASC","COMMENT ON VIEW public.active_payment_links_v IS 'Active payment links with expiry status'","-- ----------------------------------------------------------------------------\r\n-- 7. CREATE FUNCTION: Get Payment Link Status for Invoice\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.get_payment_link_status(p_invoice_id uuid)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSTABLE\r\nAS $$\r\nDECLARE\r\n    v_result json;\r\nBEGIN\r\n    SELECT json_build_object(\r\n        'has_payment_link', EXISTS (SELECT 1 FROM public.payment_links WHERE invoice_id = p_invoice_id),\r\n        'payment_link_id', pl.id,\r\n        'razorpay_link_id', pl.razorpay_link_id,\r\n        'short_url', pl.short_url,\r\n        'status', pl.status,\r\n        'expires_at', pl.expires_at,\r\n        'is_expired', pl.expires_at < NOW(),\r\n        'is_active', pl.status = 'created' AND pl.expires_at >= NOW()\r\n    )\r\n    INTO v_result\r\n    FROM public.payment_links pl\r\n    WHERE pl.invoice_id = p_invoice_id\r\n    ORDER BY pl.created_at DESC\r\n    LIMIT 1;\r\n\r\n    IF v_result IS NULL THEN\r\n        RETURN json_build_object('has_payment_link', false);\r\n    END IF;\r\n\r\n    RETURN v_result;\r\nEND;\r\n$$","COMMENT ON FUNCTION public.get_payment_link_status IS 'Get current payment link status for an invoice'","-- ----------------------------------------------------------------------------\r\n-- 8. CREATE TABLE: Email Delivery Log\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE TABLE IF NOT EXISTS public.invoice_emails (\r\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\r\n    invoice_id uuid NOT NULL REFERENCES public.invoices(id) ON DELETE CASCADE,\r\n    recipient_email text NOT NULL,\r\n    email_type text NOT NULL CHECK (email_type IN ('invoice_with_link', 'reminder', 'payment_received')),\r\n    payment_link_id uuid REFERENCES public.payment_links(id) ON DELETE SET NULL,\r\n    sent_at timestamptz DEFAULT NOW(),\r\n    email_provider_id text,\r\n    email_status text DEFAULT 'sent' CHECK (email_status IN ('sent', 'delivered', 'bounced', 'failed')),\r\n    metadata jsonb,\r\n    created_at timestamptz DEFAULT NOW()\r\n)","CREATE INDEX idx_invoice_emails_invoice_id ON public.invoice_emails(invoice_id)","CREATE INDEX idx_invoice_emails_sent_at ON public.invoice_emails(sent_at DESC)","CREATE INDEX idx_invoice_emails_status ON public.invoice_emails(email_status)","COMMENT ON TABLE public.invoice_emails IS 'Log of all invoice-related emails sent to customers'","-- ----------------------------------------------------------------------------\r\n-- 9. ENABLE RLS ON invoice_emails\r\n-- ----------------------------------------------------------------------------\r\n\r\nALTER TABLE public.invoice_emails ENABLE ROW LEVEL SECURITY","CREATE POLICY \\"Service role full access to invoice_emails\\"\r\n    ON public.invoice_emails\r\n    FOR ALL\r\n    TO service_role\r\n    USING (true)\r\n    WITH CHECK (true)","CREATE POLICY \\"Authenticated users view own invoice emails\\"\r\n    ON public.invoice_emails\r\n    FOR SELECT\r\n    TO authenticated\r\n    USING (\r\n        invoice_id IN (\r\n            SELECT id FROM public.invoices WHERE user_id = auth.uid()\r\n        )\r\n    )","-- ----------------------------------------------------------------------------\r\n-- 10. CREATE FUNCTION: Log Invoice Email\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.log_invoice_email(\r\n    p_invoice_id uuid,\r\n    p_recipient_email text,\r\n    p_email_type text,\r\n    p_payment_link_id uuid DEFAULT NULL,\r\n    p_email_provider_id text DEFAULT NULL,\r\n    p_metadata jsonb DEFAULT NULL\r\n)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_email_log_id uuid;\r\nBEGIN\r\n    INSERT INTO public.invoice_emails (\r\n        invoice_id,\r\n        recipient_email,\r\n        email_type,\r\n        payment_link_id,\r\n        email_provider_id,\r\n        metadata\r\n    ) VALUES (\r\n        p_invoice_id,\r\n        p_recipient_email,\r\n        p_email_type,\r\n        p_payment_link_id,\r\n        p_email_provider_id,\r\n        p_metadata\r\n    ) RETURNING id INTO v_email_log_id;\r\n\r\n    RETURN json_build_object(\r\n        'success', true,\r\n        'email_log_id', v_email_log_id\r\n    );\r\n\r\nEXCEPTION\r\n    WHEN OTHERS THEN\r\n        RETURN json_build_object('success', false, 'error', SQLERRM);\r\nEND;\r\n$$","COMMENT ON FUNCTION public.log_invoice_email IS 'Log email delivery for audit trail'","-- ----------------------------------------------------------------------------\r\n-- 11. GRANT PERMISSIONS\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Service-role functions\r\nGRANT EXECUTE ON FUNCTION public.store_payment_link TO service_role","GRANT EXECUTE ON FUNCTION public.expire_payment_links TO service_role","GRANT EXECUTE ON FUNCTION public.cancel_payment_link TO service_role","GRANT EXECUTE ON FUNCTION public.log_invoice_email TO service_role","-- Authenticated user functions\r\nGRANT EXECUTE ON FUNCTION public.get_invoice_for_payment_link TO authenticated","GRANT EXECUTE ON FUNCTION public.get_payment_link_status TO authenticated","-- Views\r\nGRANT SELECT ON public.invoices_needing_payment_links_v TO authenticated","GRANT SELECT ON public.active_payment_links_v TO authenticated","-- Table\r\nGRANT SELECT ON public.invoice_emails TO authenticated","GRANT ALL ON public.invoice_emails TO service_role","-- ----------------------------------------------------------------------------\r\n-- END OF MODULE 3 MIGRATION\r\n-- ----------------------------------------------------------------------------"}	module_3_payment_links
20251219170000	{"-- ============================================================================\r\n-- MODULE 6: SCHEDULING ISOLATION\r\n-- ============================================================================\r\n-- Purpose: Remove payment visibility from instructor views and enforce access control\r\n-- Dependencies: Module 5 (access_status), Module 1 (booking lifecycle)\r\n-- ============================================================================\r\n\r\n-- ----------------------------------------------------------------------------\r\n-- 1. CREATE FUNCTION: Check if instructor can view assignment\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.can_view_assignment(p_assignment_id uuid)\r\nRETURNS boolean\r\nLANGUAGE plpgsql\r\nSTABLE\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_booking_access_status text;\r\n    v_class_status text;\r\nBEGIN\r\n    -- Get booking access status and class status\r\n    SELECT \r\n        b.access_status,\r\n        ca.class_status\r\n    INTO \r\n        v_booking_access_status,\r\n        v_class_status\r\n    FROM public.class_assignments ca\r\n    JOIN public.assignment_bookings ab ON ab.assignment_id = ca.id\r\n    JOIN public.bookings b ON b.booking_id = ab.booking_id::text\r\n    WHERE ca.id = p_assignment_id\r\n    LIMIT 1;\r\n\r\n    -- Allow viewing if:\r\n    -- 1. Class is already completed/cancelled (historical record)\r\n    -- 2. Access status is active or overdue_grace (not locked)\r\n    IF v_class_status IN ('completed', 'not_conducted', 'cancelled', 'rescheduled') THEN\r\n        RETURN true;\r\n    END IF;\r\n\r\n    IF v_booking_access_status IN ('active', 'overdue_grace') THEN\r\n        RETURN true;\r\n    END IF;\r\n\r\n    -- Block if overdue_locked\r\n    RETURN false;\r\nEND;\r\n$$","COMMENT ON FUNCTION public.can_view_assignment IS 'Check if instructor can view assignment based on booking payment status'","-- ----------------------------------------------------------------------------\r\n-- 2. CREATE VIEW: Instructor classes (no payment data)\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.instructor_classes_v AS\r\nSELECT \r\n    ca.id AS assignment_id,\r\n    ca.date,\r\n    ca.start_time,\r\n    ca.end_time,\r\n    ca.class_status,\r\n    ca.attendance_locked,\r\n    ca.created_at,\r\n    ca.updated_at,\r\n    ca.instructor_id,\r\n    ct.id AS class_type_id,\r\n    ct.name AS class_type_name,\r\n    ct.duration_minutes,\r\n    b.id AS booking_id,\r\n    b.booking_id AS booking_ref,\r\n    b.first_name || ' ' || b.last_name AS student_name,\r\n    b.access_status,\r\n    b.status AS booking_status,\r\n    -- NO payment_amount, NO earnings, NO financial data\r\n    CASE \r\n        WHEN b.access_status = 'overdue_locked' AND ca.class_status NOT IN ('completed', 'not_conducted', 'cancelled', 'rescheduled') THEN true\r\n        ELSE false\r\n    END AS is_blocked\r\nFROM public.class_assignments ca\r\nLEFT JOIN public.class_types ct ON ct.id = ca.class_type_id\r\nLEFT JOIN public.assignment_bookings ab ON ab.assignment_id = ca.id\r\nLEFT JOIN public.bookings b ON b.booking_id = ab.booking_id::text\r\nWHERE \r\n    -- Only show if can_view_assignment passes\r\n    public.can_view_assignment(ca.id) = true","COMMENT ON VIEW public.instructor_classes_v IS 'Instructor-facing view without payment data'","-- ----------------------------------------------------------------------------\r\n-- 3. CREATE VIEW: Instructor upcoming classes (next 60 days)\r\n-- ----------------------------------------------------------------------------\r\n\r\nDROP VIEW IF EXISTS public.instructor_upcoming_classes_v CASCADE","CREATE OR REPLACE VIEW public.instructor_upcoming_classes_v AS\r\nSELECT *\r\nFROM public.instructor_classes_v\r\nWHERE date >= CURRENT_DATE\r\n  AND date <= CURRENT_DATE + INTERVAL '60 days'\r\n  AND class_status IN ('scheduled', 'rescheduled')\r\nORDER BY date ASC, start_time ASC","COMMENT ON VIEW public.instructor_upcoming_classes_v IS 'Instructor upcoming classes (next 60 days, no payment data)'","-- ----------------------------------------------------------------------------\r\n-- 4. CREATE VIEW: Instructor completed classes (no payment data)\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.instructor_completed_classes_v AS\r\nSELECT \r\n    assignment_id,\r\n    date,\r\n    start_time,\r\n    end_time,\r\n    class_status,\r\n    instructor_id,\r\n    class_type_name,\r\n    student_name,\r\n    booking_ref,\r\n    booking_status\r\nFROM public.instructor_classes_v\r\nWHERE class_status = 'completed'\r\nORDER BY date DESC","COMMENT ON VIEW public.instructor_completed_classes_v IS 'Instructor completed classes (no payment data)'","-- ----------------------------------------------------------------------------\r\n-- 5. CREATE FUNCTION: Get assignment roster (no booking payment status)\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.get_assignment_roster_instructor(p_assignment_id uuid)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSTABLE\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_result json;\r\nBEGIN\r\n    -- Check if instructor can view this assignment\r\n    IF NOT public.can_view_assignment(p_assignment_id) THEN\r\n        RETURN json_build_object(\r\n            'error', 'Access denied: Booking payment overdue',\r\n            'attendees', '[]'::json\r\n        );\r\n    END IF;\r\n\r\n    SELECT json_agg(\r\n        json_build_object(\r\n            'booking_id', b.id,\r\n            'booking_ref', b.booking_id,\r\n            'student_name', b.first_name || ' ' || b.last_name,\r\n            'attendance_status', aa.attendance_status,\r\n            'access_status', b.access_status,\r\n            'is_blocked', CASE WHEN b.access_status = 'overdue_locked' THEN true ELSE false END\r\n            -- NO payment_amount, NO earnings\r\n        )\r\n        ORDER BY b.first_name, b.last_name\r\n    )\r\n    INTO v_result\r\n    FROM public.assignment_bookings ab\r\n    JOIN public.bookings b ON b.booking_id = ab.booking_id::text\r\n    LEFT JOIN public.assignment_attendance aa ON aa.assignment_id = ab.assignment_id AND aa.booking_id = b.id\r\n    WHERE ab.assignment_id = p_assignment_id;\r\n\r\n    RETURN COALESCE(v_result, '[]'::json);\r\nEND;\r\n$$","COMMENT ON FUNCTION public.get_assignment_roster_instructor IS 'Get assignment roster for instructors (no payment data)'","-- ----------------------------------------------------------------------------\r\n-- 6. UPDATE RLS POLICIES: Block instructor access to financial tables\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Drop existing policies if they exist (from Module 0)\r\nDROP POLICY IF EXISTS instructors_read_invoices ON public.invoices","DROP POLICY IF EXISTS instructors_read_payment_links ON public.payment_links","DROP POLICY IF EXISTS instructors_read_transactions ON public.transactions","-- Invoices: Instructors CANNOT read invoices at all\r\nCREATE POLICY instructors_block_invoices\r\n    ON public.invoices\r\n    FOR SELECT\r\n    TO authenticated\r\n    USING (\r\n        -- Only allow if user is an admin/staff (exclude instructor role check since no instructors table)\r\n        -- For now, block all non-service reads by default\r\n        false\r\n    )","-- Payment Links: Instructors CANNOT read payment links\r\nCREATE POLICY instructors_block_payment_links\r\n    ON public.payment_links\r\n    FOR SELECT\r\n    TO authenticated\r\n    USING (\r\n        -- Block by default for instructors\r\n        false\r\n    )","-- Transactions: Instructors CANNOT read transactions\r\nCREATE POLICY instructors_block_transactions\r\n    ON public.transactions\r\n    FOR SELECT\r\n    TO authenticated\r\n    USING (\r\n        -- Block by default for instructors\r\n        false\r\n    )","COMMENT ON POLICY instructors_block_invoices ON public.invoices IS 'Block instructors from viewing invoices'","COMMENT ON POLICY instructors_block_payment_links ON public.payment_links IS 'Block instructors from viewing payment links'","COMMENT ON POLICY instructors_block_transactions ON public.transactions IS 'Block instructors from viewing transactions'","-- ----------------------------------------------------------------------------\r\n-- 7. UPDATE CLASS_ASSIGNMENTS: Add validation trigger\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.validate_class_assignment_access()\r\nRETURNS TRIGGER\r\nLANGUAGE plpgsql\r\nAS $$\r\nDECLARE\r\n    v_booking_id uuid;\r\n    v_can_schedule json;\r\nBEGIN\r\n    -- Get booking_id from assignment_bookings\r\n    SELECT b.id INTO v_booking_id\r\n    FROM public.assignment_bookings ab\r\n    JOIN public.bookings b ON b.booking_id = ab.booking_id::text\r\n    WHERE ab.assignment_id = NEW.id\r\n    LIMIT 1;\r\n\r\n    -- Skip validation if no booking found (single classes, etc.)\r\n    IF v_booking_id IS NULL THEN\r\n        RETURN NEW;\r\n    END IF;\r\n\r\n    -- Check if scheduling is allowed\r\n    v_can_schedule := public.can_schedule_class(v_booking_id);\r\n\r\n    IF (v_can_schedule->>'can_schedule')::boolean = false THEN\r\n        RAISE EXCEPTION 'Cannot schedule class: %', v_can_schedule->>'reason';\r\n    END IF;\r\n\r\n    RETURN NEW;\r\nEND;\r\n$$","-- Drop existing trigger if it exists\r\nDROP TRIGGER IF EXISTS validate_class_assignment_access_trigger ON public.class_assignments","-- Create trigger for INSERT and UPDATE\r\nCREATE TRIGGER validate_class_assignment_access_trigger\r\n    BEFORE INSERT OR UPDATE\r\n    ON public.class_assignments\r\n    FOR EACH ROW\r\n    WHEN (NEW.class_status = 'scheduled' OR NEW.class_status = 'rescheduled')\r\n    EXECUTE FUNCTION public.validate_class_assignment_access()","COMMENT ON FUNCTION public.validate_class_assignment_access IS 'Validate booking access before scheduling classes'","COMMENT ON TRIGGER validate_class_assignment_access_trigger ON public.class_assignments IS 'Enforce access control on class scheduling'","-- ----------------------------------------------------------------------------\r\n-- 8. GRANT PERMISSIONS\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Instructors can read instructor-specific views\r\nGRANT SELECT ON public.instructor_classes_v TO authenticated","GRANT SELECT ON public.instructor_upcoming_classes_v TO authenticated","GRANT SELECT ON public.instructor_completed_classes_v TO authenticated","-- Instructors can execute roster function\r\nGRANT EXECUTE ON FUNCTION public.get_assignment_roster_instructor TO authenticated","GRANT EXECUTE ON FUNCTION public.can_view_assignment TO authenticated","-- ============================================================================\r\n-- END MODULE 6\r\n-- ============================================================================"}	module_6_scheduling_isolation
