20251229150000	{"-- Migration: Add email-specific fields to notifications_queue\r\n\r\nALTER TABLE public.notifications_queue \r\n  ADD COLUMN IF NOT EXISTS subject text,\r\n  ADD COLUMN IF NOT EXISTS html text,\r\n  ADD COLUMN IF NOT EXISTS bcc text,\r\n  ADD COLUMN IF NOT EXISTS \\"from\\" text","COMMENT ON COLUMN public.notifications_queue.subject IS 'Email subject (required for channel=email)'","COMMENT ON COLUMN public.notifications_queue.html IS 'Email HTML body (required for channel=email)'","COMMENT ON COLUMN public.notifications_queue.bcc IS 'Email BCC recipients (comma-separated)'","COMMENT ON COLUMN public.notifications_queue.\\"from\\" IS 'Email from address (optional, uses default if not provided)'"}	add_email_fields_to_queue
20251219125040	{"-- ============================================================================\r\n-- MODULE 1: Booking Lifecycle Management\r\n-- ============================================================================\r\n-- Purpose: Manage booking lifecycle and access control state\r\n-- Owns: booking creation, access_status transitions, booking metadata\r\n-- Does NOT: generate invoices, handle payments, schedule classes\r\n-- ============================================================================\r\n\r\n-- ----------------------------------------------------------------------------\r\n-- 1. ADD BILLING_CYCLE_ANCHOR COLUMN\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Add billing cycle anchor (when monthly billing started)\r\nALTER TABLE public.bookings \r\nADD COLUMN billing_cycle_anchor date","-- Add index for billing queries\r\nCREATE INDEX idx_bookings_billing_cycle_anchor ON public.bookings(billing_cycle_anchor)","-- Comment\r\nCOMMENT ON COLUMN public.bookings.billing_cycle_anchor IS 'Date when monthly billing started for this booking. NULL for one-time bookings. Used to calculate billing periods.'","-- ----------------------------------------------------------------------------\r\n-- 2. ADD BOOKING_TYPE ENUM (if not already categorized)\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Add is_recurring flag to distinguish monthly vs one-time\r\nALTER TABLE public.bookings \r\nADD COLUMN is_recurring boolean DEFAULT false","-- Comment\r\nCOMMENT ON COLUMN public.bookings.is_recurring IS 'TRUE for monthly recurring bookings, FALSE for one-time/crash courses'","-- ----------------------------------------------------------------------------\r\n-- 3. CREATE ACCESS STATUS TRANSITION FUNCTION\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Function to transition booking access status\r\nCREATE OR REPLACE FUNCTION public.transition_booking_access_status(\r\n    p_booking_id uuid,\r\n    p_new_status public.access_status,\r\n    p_reason text DEFAULT NULL\r\n)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_current_status public.access_status;\r\n    v_booking_record record;\r\n    v_result json;\r\nBEGIN\r\n    -- Get current booking status\r\n    SELECT access_status, booking_id, user_id, first_name, last_name, email\r\n    INTO v_booking_record\r\n    FROM public.bookings\r\n    WHERE id = p_booking_id;\r\n\r\n    IF NOT FOUND THEN\r\n        RETURN json_build_object(\r\n            'success', false,\r\n            'error', 'Booking not found',\r\n            'booking_id', p_booking_id\r\n        );\r\n    END IF;\r\n\r\n    v_current_status := v_booking_record.access_status;\r\n\r\n    -- Validate state transition\r\n    -- Valid transitions:\r\n    -- active -> overdue_grace\r\n    -- active -> overdue_locked (skip grace if needed)\r\n    -- overdue_grace -> overdue_locked\r\n    -- overdue_grace -> active (payment received)\r\n    -- overdue_locked -> active (payment received)\r\n    \r\n    IF v_current_status = p_new_status THEN\r\n        RETURN json_build_object(\r\n            'success', true,\r\n            'message', 'Status unchanged',\r\n            'booking_id', p_booking_id,\r\n            'status', v_current_status\r\n        );\r\n    END IF;\r\n\r\n    -- Perform the update\r\n    UPDATE public.bookings\r\n    SET \r\n        access_status = p_new_status,\r\n        updated_at = now()\r\n    WHERE id = p_booking_id;\r\n\r\n    -- Log the transition (for audit trail)\r\n    INSERT INTO public.audit_logs (\r\n        table_name,\r\n        record_id,\r\n        action,\r\n        old_values,\r\n        new_values,\r\n        reason\r\n    ) VALUES (\r\n        'bookings',\r\n        p_booking_id,\r\n        'access_status_transition',\r\n        json_build_object('access_status', v_current_status),\r\n        json_build_object('access_status', p_new_status),\r\n        p_reason\r\n    );\r\n\r\n    -- Return success\r\n    RETURN json_build_object(\r\n        'success', true,\r\n        'booking_id', p_booking_id,\r\n        'booking_ref', v_booking_record.booking_id,\r\n        'user_id', v_booking_record.user_id,\r\n        'customer_name', v_booking_record.first_name || ' ' || v_booking_record.last_name,\r\n        'customer_email', v_booking_record.email,\r\n        'old_status', v_current_status,\r\n        'new_status', p_new_status,\r\n        'transitioned_at', now(),\r\n        'reason', p_reason\r\n    );\r\n\r\nEXCEPTION\r\n    WHEN OTHERS THEN\r\n        RETURN json_build_object(\r\n            'success', false,\r\n            'error', SQLERRM,\r\n            'booking_id', p_booking_id\r\n        );\r\nEND;\r\n$$","-- Comment\r\nCOMMENT ON FUNCTION public.transition_booking_access_status IS 'Transition booking access_status with validation and audit logging. Does NOT calculate timing - that is Module 5 responsibility.'","-- ----------------------------------------------------------------------------\r\n-- 4. CREATE FUNCTION TO CHECK IF BOOKING IS RECURRING\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.is_recurring_booking(p_booking_id uuid)\r\nRETURNS boolean\r\nLANGUAGE plpgsql\r\nSTABLE\r\nAS $$\r\nDECLARE\r\n    v_is_recurring boolean;\r\n    v_has_package boolean;\r\n    v_package_type text;\r\nBEGIN\r\n    -- Check if booking has is_recurring flag set\r\n    SELECT \r\n        COALESCE(b.is_recurring, false),\r\n        b.class_package_id IS NOT NULL,\r\n        cp.type\r\n    INTO \r\n        v_is_recurring,\r\n        v_has_package,\r\n        v_package_type\r\n    FROM public.bookings b\r\n    LEFT JOIN public.class_packages cp ON cp.id = b.class_package_id\r\n    WHERE b.id = p_booking_id;\r\n\r\n    IF NOT FOUND THEN\r\n        RETURN false;\r\n    END IF;\r\n\r\n    -- If explicitly marked as recurring, trust that\r\n    IF v_is_recurring THEN\r\n        RETURN true;\r\n    END IF;\r\n\r\n    -- Otherwise infer from package type\r\n    IF v_has_package AND v_package_type IN ('monthly', 'subscription') THEN\r\n        RETURN true;\r\n    END IF;\r\n\r\n    RETURN false;\r\nEND;\r\n$$","COMMENT ON FUNCTION public.is_recurring_booking IS 'Determine if a booking is monthly recurring (vs one-time/crash course)'","-- ----------------------------------------------------------------------------\r\n-- 5. CREATE FUNCTION TO INITIALIZE BILLING CYCLE\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.initialize_billing_cycle(\r\n    p_booking_id uuid,\r\n    p_start_date date DEFAULT CURRENT_DATE\r\n)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_booking_record record;\r\n    v_result json;\r\nBEGIN\r\n    -- Get booking details\r\n    SELECT id, booking_id, is_recurring, billing_cycle_anchor, class_package_id\r\n    INTO v_booking_record\r\n    FROM public.bookings\r\n    WHERE id = p_booking_id;\r\n\r\n    IF NOT FOUND THEN\r\n        RETURN json_build_object(\r\n            'success', false,\r\n            'error', 'Booking not found'\r\n        );\r\n    END IF;\r\n\r\n    -- Only initialize for recurring bookings\r\n    IF NOT COALESCE(v_booking_record.is_recurring, false) THEN\r\n        RETURN json_build_object(\r\n            'success', false,\r\n            'error', 'Cannot initialize billing cycle for non-recurring booking'\r\n        );\r\n    END IF;\r\n\r\n    -- Check if already initialized\r\n    IF v_booking_record.billing_cycle_anchor IS NOT NULL THEN\r\n        RETURN json_build_object(\r\n            'success', false,\r\n            'error', 'Billing cycle already initialized',\r\n            'existing_anchor', v_booking_record.billing_cycle_anchor\r\n        );\r\n    END IF;\r\n\r\n    -- Set the billing cycle anchor\r\n    UPDATE public.bookings\r\n    SET \r\n        billing_cycle_anchor = p_start_date,\r\n        updated_at = now()\r\n    WHERE id = p_booking_id;\r\n\r\n    RETURN json_build_object(\r\n        'success', true,\r\n        'booking_id', p_booking_id,\r\n        'booking_ref', v_booking_record.booking_id,\r\n        'billing_cycle_anchor', p_start_date,\r\n        'message', 'Billing cycle initialized successfully'\r\n    );\r\n\r\nEXCEPTION\r\n    WHEN OTHERS THEN\r\n        RETURN json_build_object(\r\n            'success', false,\r\n            'error', SQLERRM\r\n        );\r\nEND;\r\n$$","COMMENT ON FUNCTION public.initialize_billing_cycle IS 'Set billing_cycle_anchor for a recurring booking. Should be called once when booking is confirmed.'","-- ----------------------------------------------------------------------------\r\n-- 6. CREATE FUNCTION TO GET BOOKING LIFECYCLE INFO\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.get_booking_lifecycle_info(p_booking_id uuid)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSTABLE\r\nAS $$\r\nDECLARE\r\n    v_booking record;\r\n    v_is_recurring boolean;\r\n    v_active_invoice_count int;\r\n    v_pending_invoice_count int;\r\n    v_last_paid_invoice record;\r\n    v_result json;\r\nBEGIN\r\n    -- Get booking details\r\n    SELECT \r\n        id,\r\n        booking_id,\r\n        user_id,\r\n        first_name,\r\n        last_name,\r\n        email,\r\n        status,\r\n        access_status,\r\n        is_recurring,\r\n        billing_cycle_anchor,\r\n        class_package_id,\r\n        created_at\r\n    INTO v_booking\r\n    FROM public.bookings\r\n    WHERE id = p_booking_id;\r\n\r\n    IF NOT FOUND THEN\r\n        RETURN json_build_object('success', false, 'error', 'Booking not found');\r\n    END IF;\r\n\r\n    v_is_recurring := public.is_recurring_booking(p_booking_id);\r\n\r\n    -- Count invoices if recurring\r\n    IF v_is_recurring THEN\r\n        SELECT COUNT(*) INTO v_active_invoice_count\r\n        FROM public.invoices\r\n        WHERE booking_id = p_booking_id AND status IN ('pending', 'overdue');\r\n\r\n        SELECT COUNT(*) INTO v_pending_invoice_count\r\n        FROM public.invoices\r\n        WHERE booking_id = p_booking_id AND status = 'pending';\r\n\r\n        SELECT invoice_number, paid_at, total_amount\r\n        INTO v_last_paid_invoice\r\n        FROM public.invoices\r\n        WHERE booking_id = p_booking_id AND status = 'paid'\r\n        ORDER BY paid_at DESC\r\n        LIMIT 1;\r\n    END IF;\r\n\r\n    -- Build result\r\n    RETURN json_build_object(\r\n        'success', true,\r\n        'booking_id', v_booking.id,\r\n        'booking_ref', v_booking.booking_id,\r\n        'user_id', v_booking.user_id,\r\n        'customer_name', v_booking.first_name || ' ' || v_booking.last_name,\r\n        'customer_email', v_booking.email,\r\n        'booking_status', v_booking.status,\r\n        'access_status', v_booking.access_status,\r\n        'is_recurring', v_is_recurring,\r\n        'billing_cycle_anchor', v_booking.billing_cycle_anchor,\r\n        'created_at', v_booking.created_at,\r\n        'invoice_summary', CASE \r\n            WHEN v_is_recurring THEN json_build_object(\r\n                'active_unpaid_count', v_active_invoice_count,\r\n                'pending_count', v_pending_invoice_count,\r\n                'last_paid_invoice', CASE \r\n                    WHEN v_last_paid_invoice IS NOT NULL THEN json_build_object(\r\n                        'invoice_number', v_last_paid_invoice.invoice_number,\r\n                        'paid_at', v_last_paid_invoice.paid_at,\r\n                        'amount', v_last_paid_invoice.total_amount\r\n                    )\r\n                    ELSE NULL\r\n                END\r\n            )\r\n            ELSE NULL\r\n        END\r\n    );\r\n\r\nEXCEPTION\r\n    WHEN OTHERS THEN\r\n        RETURN json_build_object('success', false, 'error', SQLERRM);\r\nEND;\r\n$$","COMMENT ON FUNCTION public.get_booking_lifecycle_info IS 'Get comprehensive lifecycle information for a booking including access status, billing status, and invoice summary'","-- ----------------------------------------------------------------------------\r\n-- 7. CREATE VIEW FOR ACTIVE RECURRING BOOKINGS\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.active_recurring_bookings_v AS\r\nSELECT \r\n    b.id,\r\n    b.booking_id,\r\n    b.user_id,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    b.email AS customer_email,\r\n    b.phone,\r\n    b.access_status,\r\n    b.status AS booking_status,\r\n    b.billing_cycle_anchor,\r\n    b.class_package_id,\r\n    cp.name AS package_name,\r\n    cp.price AS package_price,\r\n    b.created_at,\r\n    b.updated_at,\r\n    COUNT(i.id) FILTER (WHERE i.status = 'pending') AS pending_invoice_count,\r\n    COUNT(i.id) FILTER (WHERE i.status = 'overdue') AS overdue_invoice_count,\r\n    MAX(i.due_date) FILTER (WHERE i.status IN ('pending', 'overdue')) AS next_due_date\r\nFROM public.bookings b\r\nLEFT JOIN public.class_packages cp ON cp.id = b.class_package_id\r\nLEFT JOIN public.invoices i ON i.booking_id = b.id\r\nWHERE b.is_recurring = true\r\n  AND b.status NOT IN ('cancelled', 'completed')\r\nGROUP BY b.id, cp.name, cp.price\r\nORDER BY b.created_at DESC","COMMENT ON VIEW public.active_recurring_bookings_v IS 'All active monthly recurring bookings with invoice summary'","-- ----------------------------------------------------------------------------\r\n-- 8. CREATE VIEW FOR LOCKED BOOKINGS (Access Control)\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.locked_bookings_v AS\r\nSELECT \r\n    b.id,\r\n    b.booking_id,\r\n    b.user_id,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    b.email AS customer_email,\r\n    b.access_status,\r\n    b.billing_cycle_anchor,\r\n    COUNT(i.id) FILTER (WHERE i.status = 'overdue') AS overdue_invoice_count,\r\n    SUM(i.total_amount) FILTER (WHERE i.status = 'overdue') AS total_overdue_amount,\r\n    MIN(i.due_date) FILTER (WHERE i.status = 'overdue') AS oldest_due_date,\r\n    CURRENT_DATE - MIN(i.due_date) FILTER (WHERE i.status = 'overdue') AS days_overdue\r\nFROM public.bookings b\r\nLEFT JOIN public.invoices i ON i.booking_id = b.id\r\nWHERE b.access_status IN ('overdue_grace', 'overdue_locked')\r\nGROUP BY b.id\r\nORDER BY days_overdue DESC NULLS LAST","COMMENT ON VIEW public.locked_bookings_v IS 'Bookings in grace period or locked state with overdue details'","-- ----------------------------------------------------------------------------\r\n-- 9. GRANT PERMISSIONS\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Grant execute on functions to authenticated users\r\nGRANT EXECUTE ON FUNCTION public.is_recurring_booking TO authenticated","GRANT EXECUTE ON FUNCTION public.get_booking_lifecycle_info TO authenticated","-- Grant execute on admin functions to service role only\r\nGRANT EXECUTE ON FUNCTION public.transition_booking_access_status TO service_role","GRANT EXECUTE ON FUNCTION public.initialize_billing_cycle TO service_role","-- Grant select on views\r\nGRANT SELECT ON public.active_recurring_bookings_v TO authenticated","GRANT SELECT ON public.locked_bookings_v TO authenticated","-- Note: Views inherit RLS from underlying tables (bookings table in this case)\r\n-- No need to create policies on views themselves\r\n\r\n-- ----------------------------------------------------------------------------\r\n-- 10. BACKFILL EXISTING BOOKINGS (Optional - safe default values)\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Mark existing bookings with packages as recurring (if not already set)\r\nUPDATE public.bookings\r\nSET is_recurring = true\r\nWHERE class_package_id IS NOT NULL\r\n  AND is_recurring IS NULL OR is_recurring = false","-- Set billing_cycle_anchor for existing recurring bookings (use created_at as fallback)\r\nUPDATE public.bookings\r\nSET billing_cycle_anchor = DATE(created_at)\r\nWHERE is_recurring = true\r\n  AND billing_cycle_anchor IS NULL","-- ----------------------------------------------------------------------------\r\n-- END OF MODULE 1 MIGRATION\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Verification queries (commented out):\r\n-- SELECT * FROM public.active_recurring_bookings_v LIMIT 10;\r\n-- SELECT * FROM public.locked_bookings_v;\r\n-- SELECT public.get_booking_lifecycle_info('some-uuid-here');\r\n-- SELECT public.is_recurring_booking('some-uuid-here');"}	module_1_booking_lifecycle
20251219150000	{"-- ============================================================================\r\n-- MODULE 4: Payment Reconciliation\r\n-- ============================================================================\r\n-- Purpose: Process Razorpay webhooks and reconcile payments with invoices\r\n-- Owns: Payment event logging, invoice status updates, transaction creation\r\n-- Does NOT: Update booking access_status (Module 5), send confirmation emails\r\n-- ============================================================================\r\n\r\n-- ----------------------------------------------------------------------------\r\n-- 0. ALTER TRANSACTIONS TABLE: Add invoice payment columns\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Add columns for Razorpay invoice payments\r\nALTER TABLE public.transactions \r\nADD COLUMN IF NOT EXISTS booking_id uuid REFERENCES public.bookings(id),\r\nADD COLUMN IF NOT EXISTS invoice_id uuid REFERENCES public.invoices(id),\r\nADD COLUMN IF NOT EXISTS transaction_type text CHECK (transaction_type IN ('payment', 'refund', 'subscription')),\r\nADD COLUMN IF NOT EXISTS payment_status text,\r\nADD COLUMN IF NOT EXISTS razorpay_payment_id text,\r\nADD COLUMN IF NOT EXISTS razorpay_payment_link_id text,\r\nADD COLUMN IF NOT EXISTS notes text","-- Create index on invoice_id for faster lookups\r\nCREATE INDEX IF NOT EXISTS idx_transactions_invoice_id ON public.transactions(invoice_id)","CREATE INDEX IF NOT EXISTS idx_transactions_booking_id ON public.transactions(booking_id)","-- ----------------------------------------------------------------------------\r\n-- 1. CREATE FUNCTION: Process Payment Event (Idempotent)\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.process_payment_event(\r\n    p_event_id text,\r\n    p_event_type text,\r\n    p_payment_link_id text,\r\n    p_razorpay_payment_id text,\r\n    p_amount numeric,\r\n    p_currency text,\r\n    p_signature_verified boolean,\r\n    p_payload jsonb\r\n)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_payment_link_id uuid;\r\n    v_invoice_id uuid;\r\n    v_invoice_number text;\r\n    v_booking_id uuid;\r\n    v_user_id uuid;\r\n    v_total_amount numeric;\r\n    v_invoice_status text;\r\n    v_payment_link_status text;\r\n    v_transaction_id uuid;\r\n    v_payment_event_id uuid;\r\nBEGIN\r\n    -- Check if event already processed (idempotency check)\r\n    IF EXISTS (SELECT 1 FROM public.payment_events WHERE event_id = p_event_id) THEN\r\n        RETURN json_build_object(\r\n            'success', true,\r\n            'message', 'Event already processed',\r\n            'event_id', p_event_id,\r\n            'idempotent', true\r\n        );\r\n    END IF;\r\n\r\n    -- Log payment event first (for audit trail)\r\n    -- First, find the payment_link UUID from razorpay_link_id\r\n    SELECT id INTO v_payment_link_id\r\n    FROM public.payment_links\r\n    WHERE razorpay_link_id = p_payment_link_id;\r\n\r\n    INSERT INTO public.payment_events (\r\n        event_id,\r\n        event_type,\r\n        payment_link_id,\r\n        signature_verified,\r\n        payload,\r\n        processed_at\r\n    ) VALUES (\r\n        p_event_id,\r\n        p_event_type,\r\n        v_payment_link_id,\r\n        p_signature_verified,\r\n        p_payload,\r\n        NOW()\r\n    ) RETURNING id INTO v_payment_event_id;\r\n\r\n    -- Get invoice details from the payment link we just found\r\n    SELECT \r\n        i.id,\r\n        i.invoice_number,\r\n        i.booking_id,\r\n        i.user_id,\r\n        i.total_amount,\r\n        i.status,\r\n        pl.status\r\n    INTO \r\n        v_invoice_id,\r\n        v_invoice_number,\r\n        v_booking_id,\r\n        v_user_id,\r\n        v_total_amount,\r\n        v_invoice_status,\r\n        v_payment_link_status\r\n    FROM public.payment_links pl\r\n    JOIN public.invoices i ON i.id = pl.invoice_id\r\n    WHERE pl.id = v_payment_link_id;\r\n\r\n    IF NOT FOUND THEN\r\n        RETURN json_build_object(\r\n            'success', false,\r\n            'error', 'Payment link not found',\r\n            'razorpay_link_id', p_payment_link_id,\r\n            'event_logged', true\r\n        );\r\n    END IF;\r\n\r\n    -- Only process if signature verified\r\n    IF NOT p_signature_verified THEN\r\n        RETURN json_build_object(\r\n            'success', false,\r\n            'error', 'Signature verification failed',\r\n            'event_logged', true\r\n        );\r\n    END IF;\r\n\r\n    -- Process based on event type\r\n    IF p_event_type IN ('payment_link.paid', 'payment.captured') THEN\r\n        -- Update invoice status to paid\r\n        UPDATE public.invoices\r\n        SET \r\n            status = 'paid',\r\n            paid_at = NOW(),\r\n            updated_at = NOW()\r\n        WHERE id = v_invoice_id\r\n          AND status = 'pending';\r\n\r\n        -- Update payment link status to paid\r\n        UPDATE public.payment_links\r\n        SET \r\n            status = 'paid',\r\n            updated_at = NOW()\r\n        WHERE id = v_payment_link_id\r\n          AND status = 'created';\r\n\r\n        -- Create transaction record\r\n        INSERT INTO public.transactions (\r\n            user_id,\r\n            booking_id,\r\n            transaction_type,\r\n            amount,\r\n            payment_method,\r\n            payment_status,\r\n            razorpay_payment_id,\r\n            razorpay_payment_link_id,\r\n            invoice_id,\r\n            notes\r\n        ) VALUES (\r\n            v_user_id,\r\n            v_booking_id,\r\n            'payment',\r\n            p_amount,\r\n            'razorpay',\r\n            'completed',\r\n            p_razorpay_payment_id,\r\n            p_payment_link_id,\r\n            v_invoice_id,\r\n            format('Payment for invoice %s', v_invoice_number)\r\n        ) RETURNING id INTO v_transaction_id;\r\n\r\n        RETURN json_build_object(\r\n            'success', true,\r\n            'message', 'Payment processed successfully',\r\n            'event_id', p_event_id,\r\n            'payment_event_id', v_payment_event_id,\r\n            'invoice_id', v_invoice_id,\r\n            'invoice_number', v_invoice_number,\r\n            'transaction_id', v_transaction_id,\r\n            'invoice_status', 'paid',\r\n            'amount', p_amount\r\n        );\r\n\r\n    ELSIF p_event_type = 'payment.failed' THEN\r\n        -- Log failure, don't update invoice status\r\n        RETURN json_build_object(\r\n            'success', true,\r\n            'message', 'Payment failure logged',\r\n            'event_id', p_event_id,\r\n            'payment_event_id', v_payment_event_id,\r\n            'invoice_id', v_invoice_id,\r\n            'action', 'no_status_change'\r\n        );\r\n\r\n    ELSIF p_event_type = 'refund.created' THEN\r\n        -- Handle refund (create negative transaction)\r\n        INSERT INTO public.transactions (\r\n            user_id,\r\n            booking_id,\r\n            transaction_type,\r\n            amount,\r\n            payment_method,\r\n            payment_status,\r\n            razorpay_payment_id,\r\n            invoice_id,\r\n            notes\r\n        ) VALUES (\r\n            v_user_id,\r\n            v_booking_id,\r\n            'refund',\r\n            -p_amount,\r\n            'razorpay',\r\n            'completed',\r\n            p_razorpay_payment_id,\r\n            v_invoice_id,\r\n            format('Refund for invoice %s', v_invoice_number)\r\n        ) RETURNING id INTO v_transaction_id;\r\n\r\n        -- Update invoice status to refunded\r\n        UPDATE public.invoices\r\n        SET \r\n            status = 'refunded',\r\n            updated_at = NOW()\r\n        WHERE id = v_invoice_id;\r\n\r\n        RETURN json_build_object(\r\n            'success', true,\r\n            'message', 'Refund processed',\r\n            'event_id', p_event_id,\r\n            'payment_event_id', v_payment_event_id,\r\n            'transaction_id', v_transaction_id,\r\n            'invoice_status', 'refunded'\r\n        );\r\n\r\n    ELSE\r\n        -- Log unknown event type\r\n        RETURN json_build_object(\r\n            'success', true,\r\n            'message', 'Event type not handled',\r\n            'event_type', p_event_type,\r\n            'event_logged', true\r\n        );\r\n    END IF;\r\n\r\nEXCEPTION\r\n    WHEN unique_violation THEN\r\n        -- Event already processed (race condition)\r\n        RETURN json_build_object(\r\n            'success', true,\r\n            'message', 'Event already processed (concurrent)',\r\n            'event_id', p_event_id,\r\n            'idempotent', true\r\n        );\r\n    WHEN OTHERS THEN\r\n        RETURN json_build_object(\r\n            'success', false,\r\n            'error', SQLERRM,\r\n            'event_id', p_event_id\r\n        );\r\nEND;\r\n$$","COMMENT ON FUNCTION public.process_payment_event IS 'Process Razorpay webhook events with idempotency (Module 4)'","-- ----------------------------------------------------------------------------\r\n-- 2. CREATE FUNCTION: Verify Payment Signature (Helper)\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.verify_razorpay_signature(\r\n    p_payload text,\r\n    p_signature text,\r\n    p_webhook_secret text\r\n)\r\nRETURNS boolean\r\nLANGUAGE plpgsql\r\nIMMUTABLE\r\nAS $$\r\nDECLARE\r\n    v_computed_signature text;\r\nBEGIN\r\n    -- Compute HMAC-SHA256 signature\r\n    v_computed_signature := encode(\r\n        hmac(p_payload::bytea, p_webhook_secret::bytea, 'sha256'),\r\n        'hex'\r\n    );\r\n\r\n    -- Compare signatures (constant-time comparison recommended in production)\r\n    RETURN v_computed_signature = p_signature;\r\nEND;\r\n$$","COMMENT ON FUNCTION public.verify_razorpay_signature IS 'Verify Razorpay webhook HMAC-SHA256 signature'","-- ----------------------------------------------------------------------------\r\n-- 3. CREATE FUNCTION: Get Payment History for Invoice\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.get_payment_history(p_invoice_id uuid)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSTABLE\r\nAS $$\r\nDECLARE\r\n    v_result json;\r\nBEGIN\r\n    SELECT json_build_object(\r\n        'invoice_id', i.id,\r\n        'invoice_number', i.invoice_number,\r\n        'status', i.status,\r\n        'total_amount', i.total_amount,\r\n        'paid_at', i.paid_at,\r\n        'payment_events', (\r\n            SELECT json_agg(\r\n                json_build_object(\r\n                    'event_id', pe.event_id,\r\n                    'event_type', pe.event_type,\r\n                    'signature_verified', pe.signature_verified,\r\n                    'processed_at', pe.processed_at\r\n                ) ORDER BY pe.processed_at DESC\r\n            )\r\n            FROM public.payment_events pe\r\n            JOIN public.payment_links pl ON pl.id = pe.payment_link_id\r\n            WHERE pl.invoice_id = i.id\r\n        ),\r\n        'transactions', (\r\n            SELECT json_agg(\r\n                json_build_object(\r\n                    'transaction_id', t.id,\r\n                    'transaction_type', t.transaction_type,\r\n                    'amount', t.amount,\r\n                    'payment_status', t.payment_status,\r\n                    'created_at', t.created_at\r\n                ) ORDER BY t.created_at DESC\r\n            )\r\n            FROM public.transactions t\r\n            WHERE t.invoice_id = i.id\r\n        )\r\n    )\r\n    INTO v_result\r\n    FROM public.invoices i\r\n    WHERE i.id = p_invoice_id;\r\n\r\n    RETURN v_result;\r\nEND;\r\n$$","COMMENT ON FUNCTION public.get_payment_history IS 'Get complete payment history for an invoice'","-- ----------------------------------------------------------------------------\r\n-- 4. CREATE VIEW: Recent Payment Events Dashboard\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.recent_payment_events_v AS\r\nSELECT \r\n    pe.id AS payment_event_id,\r\n    pe.event_id,\r\n    pe.event_type,\r\n    pe.signature_verified,\r\n    pe.processed_at,\r\n    pl.id AS payment_link_id,\r\n    pl.short_url,\r\n    pl.razorpay_link_id,\r\n    i.id AS invoice_id,\r\n    i.invoice_number,\r\n    i.total_amount AS amount,\r\n    i.currency,\r\n    i.status AS invoice_status,\r\n    b.booking_id AS booking_ref,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    b.email AS customer_email,\r\n    EXTRACT(EPOCH FROM (NOW() - pe.processed_at))/60 AS minutes_ago\r\nFROM public.payment_events pe\r\nLEFT JOIN public.payment_links pl ON pl.id = pe.payment_link_id\r\nLEFT JOIN public.invoices i ON i.id = pl.invoice_id\r\nLEFT JOIN public.bookings b ON b.id = i.booking_id\r\nORDER BY pe.processed_at DESC\r\nLIMIT 100","COMMENT ON VIEW public.recent_payment_events_v IS 'Last 100 payment events for monitoring dashboard'","-- ----------------------------------------------------------------------------\r\n-- 5. CREATE VIEW: Failed Payments Dashboard\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.failed_payments_v AS\r\nSELECT \r\n    pe.id AS payment_event_id,\r\n    pe.event_id,\r\n    pe.processed_at,\r\n    i.id AS invoice_id,\r\n    i.invoice_number,\r\n    i.total_amount AS amount,\r\n    i.due_date,\r\n    b.booking_id AS booking_ref,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    b.email AS customer_email,\r\n    b.phone AS customer_phone,\r\n    pl.short_url AS payment_link_url,\r\n    pl.razorpay_link_id,\r\n    EXTRACT(EPOCH FROM (NOW() - pe.processed_at))/3600 AS hours_since_failure\r\nFROM public.payment_events pe\r\nJOIN public.payment_links pl ON pl.id = pe.payment_link_id\r\nJOIN public.invoices i ON i.id = pl.invoice_id\r\nJOIN public.bookings b ON b.id = i.booking_id\r\nWHERE pe.event_type = 'payment.failed'\r\nORDER BY pe.processed_at DESC","COMMENT ON VIEW public.failed_payments_v IS 'Failed payment attempts for follow-up'","-- ----------------------------------------------------------------------------\r\n-- 6. CREATE VIEW: Paid Invoices Summary\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.paid_invoices_v AS\r\nSELECT \r\n    i.id AS invoice_id,\r\n    i.invoice_number,\r\n    i.booking_id,\r\n    b.booking_id AS booking_ref,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    i.total_amount,\r\n    i.currency,\r\n    i.billing_month,\r\n    i.paid_at,\r\n    t.razorpay_payment_id,\r\n    t.id AS transaction_id,\r\n    EXTRACT(EPOCH FROM (i.paid_at - i.created_at))/3600 AS hours_to_payment\r\nFROM public.invoices i\r\nJOIN public.bookings b ON b.id = i.booking_id\r\nLEFT JOIN public.transactions t ON t.invoice_id = i.id AND t.transaction_type = 'payment'\r\nWHERE i.status = 'paid'\r\nORDER BY i.paid_at DESC","COMMENT ON VIEW public.paid_invoices_v IS 'Successfully paid invoices with payment details'","-- ----------------------------------------------------------------------------\r\n-- 7. GRANT PERMISSIONS\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Service-role functions (webhook endpoint only)\r\nGRANT EXECUTE ON FUNCTION public.process_payment_event TO service_role","GRANT EXECUTE ON FUNCTION public.verify_razorpay_signature TO service_role","-- Authenticated user functions\r\nGRANT EXECUTE ON FUNCTION public.get_payment_history TO authenticated","-- Views\r\nGRANT SELECT ON public.recent_payment_events_v TO authenticated","GRANT SELECT ON public.failed_payments_v TO authenticated","GRANT SELECT ON public.paid_invoices_v TO authenticated","-- ----------------------------------------------------------------------------\r\n-- END OF MODULE 4 MIGRATION\r\n-- ----------------------------------------------------------------------------"}	module_4_payment_reconciliation
20251219180000	{"-- ============================================================================\r\n-- MODULE 7: ADMIN DASHBOARD ENHANCEMENTS\r\n-- ============================================================================\r\n-- Purpose: Admin views for invoice management, payment monitoring, and access control\r\n-- Dependencies: All previous modules (0-6)\r\n-- ============================================================================\r\n\r\n-- ----------------------------------------------------------------------------\r\n-- 1. CREATE VIEW: Admin Invoice Dashboard\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.admin_invoices_dashboard_v AS\r\nSELECT \r\n    i.id AS invoice_id,\r\n    i.invoice_number,\r\n    i.status AS invoice_status,\r\n    i.total_amount,\r\n    i.due_date,\r\n    i.created_at,\r\n    i.updated_at,\r\n    b.id AS booking_id,\r\n    b.booking_id AS booking_ref,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    b.email AS customer_email,\r\n    b.phone AS customer_phone,\r\n    b.access_status,\r\n    b.status AS booking_status,\r\n    pl.id AS payment_link_id,\r\n    pl.razorpay_link_id,\r\n    pl.short_url AS payment_link_url,\r\n    pl.status AS payment_link_status,\r\n    pl.expires_at AS payment_link_expires,\r\n    CASE \r\n        WHEN i.status = 'pending' AND i.due_date < CURRENT_DATE THEN CURRENT_DATE - i.due_date\r\n        ELSE 0\r\n    END AS days_overdue,\r\n    CASE \r\n        WHEN i.status = 'paid' THEN 'success'\r\n        WHEN i.status = 'pending' AND i.due_date >= CURRENT_DATE THEN 'warning'\r\n        WHEN i.status = 'pending' AND i.due_date < CURRENT_DATE THEN 'danger'\r\n        WHEN i.status = 'cancelled' THEN 'neutral'\r\n        ELSE 'neutral'\r\n    END AS status_severity,\r\n    COUNT(DISTINCT pe.id) AS payment_event_count,\r\n    MAX(pe.created_at) AS last_payment_event\r\nFROM public.invoices i\r\nJOIN public.bookings b ON b.id = i.booking_id\r\nLEFT JOIN public.payment_links pl ON pl.invoice_id = i.id\r\nLEFT JOIN public.payment_events pe ON pe.payment_link_id = pl.id\r\nGROUP BY \r\n    i.id, i.invoice_number, i.status, i.total_amount, i.due_date, i.created_at, i.updated_at,\r\n    b.id, b.booking_id, b.first_name, b.last_name, b.email, b.phone, b.access_status, b.status,\r\n    pl.id, pl.razorpay_link_id, pl.short_url, pl.status, pl.expires_at\r\nORDER BY i.created_at DESC","COMMENT ON VIEW public.admin_invoices_dashboard_v IS 'Admin dashboard view for invoice management'","-- ----------------------------------------------------------------------------\r\n-- 2. CREATE VIEW: Admin Payment Links Monitor\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.admin_payment_links_monitor_v AS\r\nSELECT \r\n    pl.id AS payment_link_id,\r\n    pl.razorpay_link_id,\r\n    pl.short_url,\r\n    pl.status AS link_status,\r\n    pl.created_at,\r\n    pl.expires_at,\r\n    pl.razorpay_response,\r\n    i.id AS invoice_id,\r\n    i.invoice_number,\r\n    i.status AS invoice_status,\r\n    i.total_amount,\r\n    i.due_date,\r\n    b.booking_id AS booking_ref,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    b.email AS customer_email,\r\n    b.access_status,\r\n    COUNT(DISTINCT pe.id) AS event_count,\r\n    MAX(pe.created_at) AS last_event_time,\r\n    CASE \r\n        WHEN pl.status = 'paid' THEN 'success'\r\n        WHEN pl.status = 'created' AND pl.expires_at > NOW() THEN 'active'\r\n        WHEN pl.status = 'expired' THEN 'expired'\r\n        WHEN pl.status = 'cancelled' THEN 'cancelled'\r\n        ELSE 'unknown'\r\n    END AS link_state\r\nFROM public.payment_links pl\r\nJOIN public.invoices i ON i.id = pl.invoice_id\r\nJOIN public.bookings b ON b.id = i.booking_id\r\nLEFT JOIN public.payment_events pe ON pe.payment_link_id = pl.id\r\nGROUP BY \r\n    pl.id, pl.razorpay_link_id, pl.short_url, pl.status, pl.created_at, pl.expires_at, pl.razorpay_response,\r\n    i.id, i.invoice_number, i.status, i.total_amount, i.due_date,\r\n    b.booking_id, b.first_name, b.last_name, b.email, b.access_status\r\nORDER BY pl.created_at DESC","COMMENT ON VIEW public.admin_payment_links_monitor_v IS 'Admin monitor for payment link status and events'","-- ----------------------------------------------------------------------------\r\n-- 3. CREATE VIEW: Admin Bookings Access Status\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.admin_bookings_access_v AS\r\nSELECT \r\n    b.id AS booking_id,\r\n    b.booking_id AS booking_ref,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    b.email,\r\n    b.phone,\r\n    b.status AS booking_status,\r\n    b.access_status,\r\n    b.is_recurring,\r\n    b.billing_cycle_anchor,\r\n    b.created_at,\r\n    b.updated_at,\r\n    COUNT(DISTINCT i.id) FILTER (WHERE i.status = 'pending') AS pending_invoices,\r\n    COUNT(DISTINCT i.id) FILTER (WHERE i.status = 'paid') AS paid_invoices,\r\n    COUNT(DISTINCT i.id) FILTER (WHERE i.status = 'overdue') AS overdue_invoices,\r\n    SUM(i.total_amount) FILTER (WHERE i.status = 'pending') AS total_pending_amount,\r\n    MAX(i.due_date) FILTER (WHERE i.status = 'pending') AS next_due_date,\r\n    COUNT(DISTINCT ca.id) FILTER (WHERE ca.class_status = 'scheduled' AND ca.date >= CURRENT_DATE) AS upcoming_classes,\r\n    COUNT(DISTINCT ca.id) FILTER (WHERE ca.class_status = 'completed') AS completed_classes,\r\n    CASE \r\n        WHEN b.access_status = 'active' THEN 'success'\r\n        WHEN b.access_status = 'overdue_grace' THEN 'warning'\r\n        WHEN b.access_status = 'overdue_locked' THEN 'danger'\r\n        ELSE 'neutral'\r\n    END AS access_severity\r\nFROM public.bookings b\r\nLEFT JOIN public.invoices i ON i.booking_id = b.id\r\nLEFT JOIN public.assignment_bookings ab ON ab.booking_id::text = b.booking_id\r\nLEFT JOIN public.class_assignments ca ON ca.id = ab.assignment_id\r\nGROUP BY \r\n    b.id, b.booking_id, b.first_name, b.last_name, b.email, b.phone, \r\n    b.status, b.access_status, b.is_recurring, b.billing_cycle_anchor, b.created_at, b.updated_at\r\nORDER BY \r\n    CASE b.access_status\r\n        WHEN 'overdue_locked' THEN 1\r\n        WHEN 'overdue_grace' THEN 2\r\n        WHEN 'active' THEN 3\r\n        ELSE 4\r\n    END,\r\n    b.updated_at DESC","COMMENT ON VIEW public.admin_bookings_access_v IS 'Admin view of bookings with access status and payment summary'","-- ----------------------------------------------------------------------------\r\n-- 4. CREATE VIEW: Admin Payment Events Log\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE VIEW public.admin_payment_events_log_v AS\r\nSELECT \r\n    pe.id AS event_id,\r\n    pe.event_id AS razorpay_event_id,\r\n    pe.event_type,\r\n    pe.signature_verified,\r\n    pe.processed_at,\r\n    pe.processing_error,\r\n    pe.created_at,\r\n    pl.razorpay_link_id,\r\n    pl.short_url AS payment_link_url,\r\n    pl.status AS link_status,\r\n    i.invoice_number,\r\n    i.total_amount,\r\n    b.booking_id AS booking_ref,\r\n    b.first_name || ' ' || b.last_name AS customer_name,\r\n    CASE \r\n        WHEN pe.processing_error IS NOT NULL THEN 'error'\r\n        WHEN pe.processed_at IS NOT NULL THEN 'processed'\r\n        ELSE 'pending'\r\n    END AS processing_status\r\nFROM public.payment_events pe\r\nJOIN public.payment_links pl ON pl.id = pe.payment_link_id\r\nJOIN public.invoices i ON i.id = pl.invoice_id\r\nJOIN public.bookings b ON b.id = i.booking_id\r\nORDER BY pe.created_at DESC","COMMENT ON VIEW public.admin_payment_events_log_v IS 'Admin log of all payment webhook events'","-- ----------------------------------------------------------------------------\r\n-- 5. CREATE FUNCTION: Admin - Manually Trigger Invoice Generation\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.admin_generate_invoice(p_booking_id uuid)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_result json;\r\nBEGIN\r\n    -- Generate first invoice if billing_cycle_anchor is set\r\n    PERFORM public.generate_first_invoice(p_booking_id);\r\n    \r\n    -- Return invoice details\r\n    SELECT json_build_object(\r\n        'success', true,\r\n        'invoice_id', i.id,\r\n        'invoice_number', i.invoice_number,\r\n        'total_amount', i.total_amount,\r\n        'due_date', i.due_date\r\n    )\r\n    INTO v_result\r\n    FROM public.invoices i\r\n    WHERE i.booking_id = p_booking_id\r\n    ORDER BY i.created_at DESC\r\n    LIMIT 1;\r\n    \r\n    RETURN COALESCE(v_result, json_build_object('success', false, 'error', 'No invoice generated'));\r\nEND;\r\n$$","COMMENT ON FUNCTION public.admin_generate_invoice IS 'Admin function to manually trigger invoice generation'","-- ----------------------------------------------------------------------------\r\n-- 6. CREATE FUNCTION: Admin - Manually Create Payment Link\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.admin_create_payment_link(p_invoice_id uuid)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_invoice_data json;\r\nBEGIN\r\n    -- Get invoice data for payment link creation\r\n    SELECT public.get_invoice_for_payment_link(p_invoice_id)\r\n    INTO v_invoice_data;\r\n    \r\n    -- Return invoice data (actual link creation happens via edge function)\r\n    RETURN json_build_object(\r\n        'success', true,\r\n        'invoice_id', p_invoice_id,\r\n        'invoice_data', v_invoice_data,\r\n        'message', 'Call create-payment-link edge function with this invoice_id'\r\n    );\r\nEND;\r\n$$","COMMENT ON FUNCTION public.admin_create_payment_link IS 'Admin function to prepare payment link creation'","-- ----------------------------------------------------------------------------\r\n-- 7. CREATE FUNCTION: Admin - Manually Escalate Booking\r\n-- ----------------------------------------------------------------------------\r\n\r\nCREATE OR REPLACE FUNCTION public.admin_escalate_booking(p_booking_id uuid)\r\nRETURNS json\r\nLANGUAGE plpgsql\r\nSECURITY DEFINER\r\nAS $$\r\nDECLARE\r\n    v_payment_status json;\r\n    v_new_status text;\r\nBEGIN\r\n    -- Check payment status\r\n    v_payment_status := public.check_booking_payment_status(p_booking_id);\r\n    \r\n    -- Get recommended status\r\n    v_new_status := v_payment_status->>'recommended_status';\r\n    \r\n    -- Transition to recommended status\r\n    PERFORM public.transition_booking_access_status(\r\n        p_booking_id,\r\n        v_new_status::text,\r\n        'Manual escalation by admin'\r\n    );\r\n    \r\n    RETURN json_build_object(\r\n        'success', true,\r\n        'booking_id', p_booking_id,\r\n        'new_status', v_new_status,\r\n        'payment_status', v_payment_status\r\n    );\r\nEND;\r\n$$","COMMENT ON FUNCTION public.admin_escalate_booking IS 'Admin function to manually escalate booking access status'","-- ----------------------------------------------------------------------------\r\n-- 8. GRANT PERMISSIONS\r\n-- ----------------------------------------------------------------------------\r\n\r\n-- Admins can read all admin views\r\nGRANT SELECT ON public.admin_invoices_dashboard_v TO authenticated","GRANT SELECT ON public.admin_payment_links_monitor_v TO authenticated","GRANT SELECT ON public.admin_bookings_access_v TO authenticated","GRANT SELECT ON public.admin_payment_events_log_v TO authenticated","-- Admins can execute admin functions\r\nGRANT EXECUTE ON FUNCTION public.admin_generate_invoice TO authenticated","GRANT EXECUTE ON FUNCTION public.admin_create_payment_link TO authenticated","GRANT EXECUTE ON FUNCTION public.admin_escalate_booking TO authenticated","-- ============================================================================\r\n-- END MODULE 7\r\n-- ============================================================================"}	module_7_admin_dashboard
20251228230511	{"-- Migration: create wa_templates table for storing WhatsApp (Meta) templates\r\ncreate table if not exists wa_templates (\r\n  id uuid default gen_random_uuid() primary key,\r\n  key text not null,\r\n  meta_name text not null,\r\n  language text not null,\r\n  category text,\r\n  status text,\r\n  components jsonb not null,\r\n  variables jsonb default '[]'::jsonb,\r\n  example jsonb default '[]'::jsonb,\r\n  has_buttons boolean default false,\r\n  button_types jsonb default '[]'::jsonb,\r\n  approved boolean default false,\r\n  version int default 1,\r\n  created_by text,\r\n  created_at timestamptz default now()\r\n)","create unique index if not exists wa_templates_key_lang_idx on wa_templates (key, language)"}	create_wa_templates
